import React from 'react';

const Footer = () =>{
    const year = new Date().getFullYear();
    return (
        <>
        <footer style={{marginBottom:"0", position: "fixed"}}>
            <p>Copyright ©️ {year} </p>
        </footer>
        </>
    )
}
export default Footer;
